import React, { useState } from 'react';

const PrivateNavbar: React.FC = () => {
  const [isClose, setIsClose] = useState(false);

  const toggleMenu = () => {
    setIsClose(!isClose);
  };

  return (
    <div className={`base ${isClose ? 'close' : ''}`}>
      <div className="menu" onClick={toggleMenu}>
        <div className="icon">
          <div className="bar"></div>
        </div>
      </div>
      <div className="icons">
        {/* Replace these with appropriate icon components or images */}
        <i className="fa fa-user" aria-hidden="true">test</i>
        <i className="fa fa-calendar-o" aria-hidden="true">test</i>
        <i className="fa fa-tachometer" aria-hidden="true">test</i>
      </div>
      <div className="section">
        <div className="cover1">
          <div className="cover2">
            <a className="content" href="#calender">test</a>
          </div>
        </div>
      </div>
      <a className="section-static top" href="#profile">test</a>
      <a className="section-static bottom" href="#dashboard">test</a>
    </div>
  );
};

export default PrivateNavbar;
